import React from 'react'
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
const Navbar = ()  => {
    return (
        <ul>
            <li>
                <Link to='/home'>Home</Link>
            </li>
        </ul>
    )
}

Navbar.propTypes = {
    title: PropTypes.string.isRequired,
    icon: PropTypes.string
  };

export default Navbar
